import random
import matplotlib.pyplot as plt

SHOTS_TO_MAKE_CONSEQUTIVELY = 40
FREE_THROW_PROP = 0.9

def simulate_free_throw_sequence(shots_to_make_consequetively, free_throw_prop):
    free_throw_attempts = 0
    shots_consequtively = 0
    while shots_consequtively < shots_to_make_consequetively:
        free_throw = random.uniform(0, 1) < free_throw_prop
        free_throw_attempts += 1
        if free_throw:
            shots_consequtively += 1
        else:
            shots_consequtively = 0
    return free_throw_attempts

def monte_carlo(number_of_simulations):
    # run the monte carlo simulation
    monte_carlo = []
    for i in range(number_of_simulations):
        monte_carlo.append(simulate_free_throw_sequence(SHOTS_TO_MAKE_CONSEQUTIVELY, FREE_THROW_PROP))
        # print("simulation {} done".format(i))
    return monte_carlo

def mean(array):
    return sum(array) / len(array)


